import "../styleComponents/content.css";
import "../styleComponents/footer.css";
import Pic from "../bgimg.png"
import Footer from "./footer";
import Navbarr from "./navbar"
import Button from "./button";

const Content = () => {
    return (
        <>
            <Navbarr />
            <div className="container">
                <div className="text-content">
                    <h3>Welcome to</h3>
                    <h1>The Study Helper</h1>
                    <p>A place where you can solve all study related queries, hangout with new friends and much more!</p>
                </div>
            <img className="img" src={Pic} alt="img"/>
            </div>
            <Footer className="fixed-bottom" />
            </>
    )
}

export default Content;
